import React from "react"
import styles from './SilidingBlock.module.scss'
import '../../sours/icon/style.css'


interface SlidingBlockProps {
    silidingIcon?: 'down' | 'left'
    silidingDirection?: 'vertically' | 'horizontally'
    contentOnBlok: React.ReactNode
    contentInBlok: React.ReactNode
}

export default function SlidingBlock(
    {
        silidingIcon = 'down',
        silidingDirection = 'vertically',
        contentOnBlok,
        contentInBlok
    }: SlidingBlockProps
) {
    return (
        <div className={styles['SilidingBlock-' + silidingDirection]}>
            <div className={styles["SilidingBlock-on"]}>
                {contentOnBlok}
                <i className={'ic_arrow_' + silidingIcon}></i>
            </div>
            <div className={styles["SilidingBlock-in"]}>
                {contentInBlok}
            </div>
        </div>
    )
}
